Answer: \section{The problem is that you're not using `std::string` correctly.}

You have to use `std::string` as a string literal in C++.  You can't just declare one on the stack or heap and then pass it around.  It has to be declared at compile time (in this case, when you define the function).

So instead of doing this:

\begin{blockquote}

\begin{code}
std::string input;
input = ".";
\end{code}

you need to do this:

\begin{code}
std::string input(".");
\end{code}

